import React, { Component } from 'react'
import styled from 'styled-components';

const CardPDiv = styled.div`
  display: grid;
  grid-template-columns: repeat(10, 1fr); 
  gap: 8px; 
   background-image: linear-gradient(135deg, #f83600 0%, #f9d423 100%); 
`;

const TempColumn = styled.div`
  text-align: center;
  padding: 8px;
  background-color: transparent;
color:white;
`;

const TempRow = styled.div`
  text-align: center;
  padding: 8px;
  background-color: transparent;
  color:white;
  
`;
const HourColumn = styled.div`
  text-align: center;
  padding: 8px;
  background-color: transparent;
color:white;
`;

const Barra = styled.div`
 
  width: 10%;
  height:60px;
  display:flex;
  content-align:center;
  
  background: white;

  transform-origin: bottom;
`;
export class CardP extends Component {
  render() {
    return (
      <CardPDiv>
      <TempColumn> 
      <TempRow>40</TempRow>
      <TempRow>20</TempRow>
      <TempRow>0</TempRow>
      Temperaturas
      </TempColumn>
        <HourColumn>0</HourColumn>
        <HourColumn><Barra></Barra>3</HourColumn>
        <HourColumn>6</HourColumn>
        <HourColumn>9</HourColumn>
        <HourColumn>12</HourColumn>
        <HourColumn>15</HourColumn>
        <HourColumn>18</HourColumn>
        <HourColumn>21</HourColumn>
        <HourColumn>24</HourColumn>
        

      </CardPDiv>
    )
  }
}

export default CardP
